import React from "react";

import { Props } from "./types";
import * as Styled from "./style";

const Banner = ({}: Props) => {
  return (
    <Styled.MainBanner>
      <Styled.Title fontSize={[30, 20, 10]} >Funk explode em</Styled.Title>
      <Styled.Description fontSize={[30, 20, 10]} >Titulo da pagina</Styled.Description>
      <Styled.Span fontSize={[30, 20, 10]} >Titulo da pagina</Styled.Span>
      <Styled.Btn> fontSize={[30, 20, 10]} >Titulo da pagina</Styled.Btn>
    </Styled.MainBanner>
  )
};

export default Banner;
